import base64
import zlib
import lzma
import bz2
import marshal

encoded_script = """

"""
compressed_bz2 = base64.b64decode(encoded_script)
compressed_lzma = bz2.decompress(compressed_bz2)
compressed_zlib = lzma.decompress(compressed_lzma)
serialized_script = zlib.decompress(compressed_zlib)
original_script = marshal.loads(serialized_script)
exec(original_script)
